import SearchBar from "./SearchBWF/SearchBar";
import { useState, useEffect } from 'react';
import FilterT from "./SearchBWF/FilterT";
import Filterl from "./SearchBWF/FilterL";
import octokit from "../Githubclient/GithubC";


const RepoResPage = () => {
  const [code, setCode] = useState(null);

  useEffect(() => {
    async function fetchData() {
      try {
        const response = await octokit.request('GET /repos/{owner}/', {
          owner: 'MHZ0',
        });
        setCode(response.data); // Assuming you want to store the data in the 'code' state
        console.log(response.data);
      } catch (error) {
        console.log(error);
      }
    }

    fetchData(); // Call the fetchData function within the useEffect
  }, []); // The empty dependency array means this effect runs once when the component mounts

  return (

    <div className="flex flex-col items-end justify-end ml-auto" style={{ width: '72vw' }}>
      <div className="flex items-center justify-center">

        <SearchBar />
        <FilterT />
        <Filterl />

      </div>

      <div className="border-y border-gray-300 mx-2 mb-2 w-full">
        
      </div>
    </div>
  );
};

export default RepoResPage;
